import './App.css';
import Header from "./components/header"
import HomePage from "./components/home"
import FormationPage from "./components/formations"

let menuItems = document.querySelectorAll(".menuChild");
menuItems.forEach(menulink=>{
  menulink.addEventListener("click",e=>{
    console.log("hello")
  })
})


function App(page = "home") {
  return(
    <div className="App">

	    <Header/>
      <FormationPage/>

    </div>
  )
  // HOMEPAGE
  return (
    <div className="App">

	    <Header/>
      <HomePage/>

    </div>
  );
}

export default App;
